import { mapState } from 'vuex';
export default {
    name: 'searchFrom',
    props: {
        typeName: Array
    },
    data () {
        return {
            currentTab: '',
            grid: {
                xl: 8,
                lg: 8,
                md: 8,
                sm: 24,
                xs: 24
            },
            // collapse: false,
            // 搜索条件
            DataList: {
                status: '',
                data: '',
                real_name: ''
            },
            rules: {

            },
            statusType: '',
            time: '',
            value2: []
        }
    },
    computed: {
        ...mapState('admin/layout', [
            'isMobile'
        ]),
        ...mapState('admin/order', [
            'orderChartType'
        ]),
        labelWidth () {
            return this.isMobile ? undefined : 80;
        },
        labelPosition () {
            return this.isMobile ? 'top' : 'right';
        }
    },
    methods: {
        // 订单选择状态
        selectChange (status) {
            this.$emit('getTypeNum', status);
        },
        // 时间状态
        timeChange (time) {
            this.$emit('getSeachTime', time);
        },
        // 订单号搜索
        orderSearch (num) {
            this.getOrderNum(num);
            this.$emit('getList');
        },
        // 点击订单类型
        onClickTab () {
            this.$emit('onChangeType', this.currentTab);
        },
        handleSubmit () {
            this.$emit('on-submit', this.data);
        },
        // 刷新
        Refresh () {
            this.$emit('getList');
        },
        handleReset () {
            this.$refs.form.resetFields();
            this.$emit('on-reset');
        }
    }
}
